import React from "react";
import "./css/Midsection.css";
import NurseImage from "./Images/nurse_midsec.jpg";

function MidSection() {
  return (
    <div className="midsection">
      <div className="midsection__info__container">
        <div className="border__left"></div>
        <div className="info__midSec"></div>
        <img src={NurseImage} alt="" className="nurseImg__midSec" />
      </div>
    </div>
  );
}

export default MidSection;
